(defn term-finder 
  ":a  [2 0 0 0]
   :b  [0 2 0 0]
   :c  [0 0 2 0]
   :d  [0 0 0 2]
   :e  [1 1 0 0]"
  [x]
  (let [y {:a (count (filter #{[2 0 0 0]} x)) :b (count (filter #{[0 2 0 0]} x)) :c  (count (filter #{[0 0 2 0]} x))  :d (count (filter #{[0 0 0 2]} x)) :e (count (filter #{[1 1 0 0]} x))}]
              
              y))
